// src/components/Sidebar.js
import React from 'react';
import '../styles/Sidebar.css';

function Sidebar() {
  return (
    <aside className="sidebar">
      <h2>Data Layers</h2>
      <ul className="layer-list">
        <li><input type="checkbox" /> Crime Rate</li>
        <li><input type="checkbox" /> Property Tax</li>
        <li><input type="checkbox" /> Development Permits</li>
        {/* Add more toggles later */}
      </ul>
    </aside>
  );
}

export default Sidebar;
